import React from "react";
import { Helmet } from "react-helmet";
import { Button, Text, Input, Img } from "../../components";

export default function FirsttimesigninEnterProfileInformationPage() {
  return (
    <>
      <Helmet>
        <title>Profile Setup - Enter Your Information</title>
        <meta
          name="description"
          content="Start your journey with us by entering your profile information. Include your ID, name, age, weight, and any dietary restrictions to personalize your experience."
        />
      </Helmet>

      {/* profile information section */}
      <div className="w-full bg-blue_gray-100_01">
        {/* logo and form container section */}
        <div className="flex items-center justify-between gap-5 bg-blue_gray-800 p-11 md:flex-col md:p-5">
          {/* logo section */}
          <Img
            src="images/img_logo.png"
            alt="house1three_one"
            className="mb-[110px] ml-[13px] h-[376px] w-[376px] self-end object-cover md:ml-0 md:w-full"
          />

          {/* form section */}
          <div className="mr-[31px] h-[632px] w-[45%] bg-[url(/public/images/img_group_18.svg)] bg-cover bg-no-repeat p-[42px] md:mr-0 md:h-auto md:w-full md:p-5">
            {/* profile entry instructions section */}
            <div className="mb-[5px] mt-[21px] flex flex-col gap-5">
              {/* profile information header section */}
              <Text size="lg" as="p" className="w-[81%] md:w-full">
                Enter your profile information
              </Text>

              {/* user details form section */}
              <div className="flex flex-col items-start">
                {/* id name row section */}
                <div className="flex items-center justify-between gap-5 self-stretch sm:flex-col">
                  {/* id label section */}
                  <Text
                    size="s"
                    as="p"
                    className="flex h-[63px] w-[63px] items-center justify-center rounded-[31px] bg-blue_gray-800 text-center !text-blue_gray-100_01"
                  >
                    ID
                  </Text>

                  {/* name input section */}
                  <Input
                    shape="square"
                    type="text"
                    name="name"
                    placeholder={`Name:`}
                    className="mb-1.5 w-[77%] self-end sm:w-full sm:pr-5"
                  />
                </div>

                {/* age input section */}
                <Input shape="square" name="age" placeholder={`Age: `} className="mt-[19px] self-stretch sm:pr-5" />

                {/* weight input section */}
                <Input
                  shape="square"
                  name="weightlbs"
                  placeholder={`Weight (lbs): `}
                  className="mt-[21px] self-stretch sm:pr-5"
                />

                {/* dietary restrictions dropdown section */}
                <Input
                  shape="square"
                  name="arrowdown"
                  placeholder={`Dietary Restrictions`}
                  prefix={
                    <div className="mr-[-132px] flex h-[8px] w-[14px] items-center justify-center">
                      <Img src="images/img_arrowdown.svg" alt="arrow_down" className="h-[8px] w-[14px]" />
                    </div>
                  }
                  className="mt-[19px] self-stretch sm:px-5"
                />

                {/* continue button stack section */}
                <div className="relative ml-[101px] mt-[49px] h-[45px] w-[62%] md:ml-0 md:h-auto">
                  {/* continue text section */}
                  <Text size="s" as="p" className="mb-[7px] text-center !text-blue_gray-100_01">
                    Continue
                  </Text>

                  {/* continue button section */}
                  <Button
                    shape="round"
                    className="absolute bottom-0 left-0 right-0 top-0 m-auto w-max min-w-[199px] !rounded-[22px] sm:px-5"
                  >
                    Continue
                  </Button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
